import React from 'react';
import './LinkButton.css';

function LinkButton({ url, text }) {
  return (
    <a
      href={url}
      target="_blank"
      rel="noopener noreferrer"
      className="link-button"
    >
      {text}
    </a>
  );
}

export default LinkButton;
